import React, { useState } from 'react';

const Carousel = () => {

    const [num, setNum] = useState(31)

    return(
        <>
            <div className='main_div'>
                <div className='center_div'>
                    <h1>{num}</h1>
                    <div className='btn_div'>
                        <button>+</button>
                        <button>-</button>
                    </div>
                </div>
            </div>
        </>
    )
}

export default Carousel;
